Return type: any Returns: a variable that could've been set from another mod. The return value can only be one of the following types: nil, string, number, bool, UObject(+derivatives), lightuserdata. Example -- Assuming that the example script for 'SetSharedVariable' has been executed.
local SharedObject = ModRef:GetSharedVariable("MyVariable") -- 'GetSharedVariable' may return anything that its able to store.
-- Any mod is able to override the value for any shared variable.
if SharedObject and type(SharedObject) == "userdata" and SharedObject:type() == "UObject" and SharedObject:IsValid() then print(string.format("SharedObject '%s' is valid.\n", SharedObject:GetFullName()))
else print("SharedObject was nil, not userdata, not a UObject, or an invalid UObject")
end

